  ///  Exercise Description Strings
  'ex_desc_1': "Párate en el piso con los brazos extendidos\nrecto a un lado a la altura del hombro.\n\nMueve los brazos en el sentido de las agujas del reloj en grandes círculos rápidamente.\n\nIntenta hacerlo lo más rápido que puedas.\n\nEs un gran ejercicio para el músculo deltoides.",
  'ex_desc_2': "Comience con los pies juntos y los brazos a los lados, luego salta con los pies separados y las manos por encima.\n\nRegrese a la posición de inicio y luego haz el siguiente representante.\n\nEste ejercicio proporciona un entrenamiento de cuerpo completo y funciona todos sus grupos musculares grandes.",
  'ex_desc_3': "Párese derecho con los pies juntos y los brazos a los lados.\n\nPase un pie hacia un lado, levante los brazos hacia arriba y levante las manos por encima.\n\nregresa, cambia los lados y repite el ejercicio.",
  'ex_desc_4': "Párese con los pies del ancho del hombro y su ARMA se estiró hacia adelante, luego baje el cuerpo hasta que los muslos estén paralelos al piso.\n\nsus rodillas deben extenderse en la misma dirección que sus dedos de los pies.\n\nRegrese a la posición de inicio y haga la siguiente representante.\n\nesto funciona los muslos, las nalgas de caderas, los quads, los isquiotibiales y la parte inferior del cuerpo.",
  'ex_desc_5': "Comience a cuatro patas con las rodillas debajo de su trasero y las manos debajo de los hombros.\n\nluego levante la pierna derecha y apriete el trasero tanto como pueda.\n\nvuelve a la posición de inicio y repita el ejercicio.",
  'ex_desc_6': "Comience a cuatro patas con las rodillas debajo de su trasero y las manos debajo de los hombros.\n\nluego levante la pierna izquierda y apriete el trasero tanto como pueda.\n\nvuelve a la posición de inicio y repita el ejercicio.",
  'ex_desc_7': "Acuéstese boca arriba con las rodillas dobladas y los pies planos en el piso.\n\nPon los brazos planos a los lados.\n\nLuego levante el trasero hacia arriba y hacia abajo.",
  'ex_desc_8': "Comience a cuatro patas con las rodillas debajo de su trasero y sus manos directamente debajo de los hombros.\n\nluego respira y haz que tu vientre se caiga, los hombros se trasladan hacia atrás y la cabeza sube hacia el techo.\n\nMientras exhala, curva la espalda hacia arriba y deja que tu cabeza caiga.\n\nrepite el ejercicio.\n\nhazlo lentamente con cada paso de este ejercicio.",
  'ex_desc_9': "Párate con el ancho del hombro de los pies separados.\n\ntrae tu rodilla a tu codo opuesto.\n\nRegrese a la posición de inicio y repita con el otro lado.",
  'ex_desc_10': "Párese a varios metros de un banco. Descansa tu pie izquierdo en el banco detrás de ti.\n\nbaje el cuerpo hasta que su rodilla trasera casi toque el piso y su muslo delantero esté paralelo al piso.\n\nluego vuelve a la posición de inicio y repita el ejercicio.\n\ndebe haber suficiente espacio entre el pie delantero y el banco para que su rodilla delantera no se pase de los dedos de los pies. Mantenga la parte superior de su cuerpo recta.\n\nes un gran ejercicio para el glúteo y los isquiotibiales.",
  'ex_desc_11': "Párese a varios metros de un banco. Descansa tu pie derecho en el banco detrás de ti.\n\nbaje el cuerpo hasta que su rodilla trasera casi toque el piso y su muslo delantero esté paralelo al piso.\n\nluego vuelve a la posición de inicio y repita el ejercicio.\n\ndebe haber suficiente espacio entre el pie delantero y el banco para que su rodilla delantera no se pase de los dedos de los pies. Mantenga la parte superior de su cuerpo recta.\n\nes un gran ejercicio para el glúteo y los isquiotibiales.",
  'ex_desc_12': "Párate con una de tus piernas hacia adelante y las rodillas se doblaron ligeramente. Dobla los codos y aprieta los puños frente a tu cara.\n\nextiende un brazo hacia adelante con la palma hacia el piso. Tome el brazo hacia atrás y repita con el otro brazo.",
  'ex_desc_13': "Comience en la posición del tablón del brazo recto. Luego, alternativamente, levante y baje ambas piernas hacia arriba y hacia abajo. \norte",
  'ex_desc_14': "Acuéstese sobre su estómago y dobla los codos con las manos debajo de los hombros.\n\nluego empuje su pecho hacia arriba del suelo lo más posible. Regrese a la posición de inicio y repita.",
  'ex_desc_15': "Párate con la mano derecha levantada por encima y la mano izquierda en la cintura.\nTraiga su codo derecho y su rodilla derecha para encontrarse. Estirar y repetir.",
  'ex_desc_16': "Párate con la mano izquierda levantada por encima y la mano derecha en la cintura.\n\nTraiga el codo izquierdo y la rodilla izquierda para encontrarse. Estirar y repetir.",
  'ex_desc_17': "Acuéstese boca arriba con las rodillas en un ángulo de 90 grados y las manos detrás de la cabeza.\n\nlevante la parte superior del cuerpo y los muslos, y luego estire.\n\nrepite este ejercicio.",
  'ex_desc_18': "Comience a cuatro patas con las rodillas debajo de su trasero y sus manos directamente debajo de los hombros.\n\ndobla los codos y haz una flexión. Regrese a la posición de inicio y repita.",
  'ex_desc_19': "Comience a cuatro patas con las rodillas debajo de su trasero y las manos debajo de los hombros.\n\nluego levante la pierna derecha hacia un lado en un ángulo de 90 grados.",
  'ex_desc_20': "Comience a cuatro patas con las rodillas debajo de su trasero y las manos debajo de los hombros.\n\nluego levante la pierna izquierda hacia un lado en un ángulo de 90 grados.",
  'ex_desc_21': "Acuéstese a su lado con la cabeza descansado sobre su brazo derecho.\n\nLevante la pierna superior y regrese a la posición de inicio.\n\nAsegúrate de que tu pierna derecha suba y baja durante el ejercicio.\n\nEs un gran ejercicio para el glúteo.",
  'ex_desc_22': "Acuéstese a su lado con la cabeza descansado sobre su brazo derecho.\n\nLevante la pierna superior y regrese a la posición de inicio.\n\nasegúrese de que su pierna izquierda vaya hacia arriba y hacia abajo durante el ejercicio.\n\nEs un gran ejercicio para el glúteo.",
  'ex_desc_23': "Acuéstese en el piso con las manos detrás de las orejas.\n\nlevanta las rodillas y cierre el codo derecho hacia la rodilla izquierda, luego cierre el codo izquierdo hacia la rodilla derecha.\n\nrepite el ejercicio.",
  'ex_desc_24': "Párate con los pies de ancho del hombro y tus manos en las caderas.\n\nda un paso adelante con la pierna derecha y baje el cuerpo hasta que el muslo derecho esté paralelo al piso.\n\nluego regrese y cambie a la otra pierna.\n\nEste ejercicio fortalece los cuádriceps, el glúteo maximus y los isquiotibiales.",
  'ex_desc_25': "Párate con las manos en las caderas y los pies un poco más ancho que el ancho del hombro.\n\nluego baje el cuerpo hasta que sus muslos estén paralelos al piso.\n\nsus rodillas deben extenderse en la misma dirección que sus puntillas.",
  'ex_desc_26': "Acuéstese boca arriba con los pies planos en el piso. Pon tu tobillo derecho sobre tu rodilla izquierda.\n\nLevanta la rodilla izquierda y toma la parte posterior de su muslo izquierdo con ambas manos. Tíralo suavemente hacia tu cuerpo.",
  'ex_desc_27': "Acuéstese boca arriba con los pies planos en el piso. Pon el tobillo izquierdo en tu rodilla derecha.\n\nLevanta la rodilla derecha y toma la parte posterior de tu muslo derecho con ambas manos. Suavemente tíralo hacia tu cuerpo.",
  'ex_desc_28': "Comience en la posición de flexión.\n\ndobla la rodilla derecha hacia su pecho y mantén la pierna izquierda recta, luego cambia rápidamente de una pierna a la otra.\n\nEste ejercicio fortalece múltiples grupos musculares.",
  'ex_desc_29': "Acuéstese boca arriba con los brazos a los lados.\n\nlevanta las piernas y manténgalas lo más recto como pueda.\n\nluego levante rápidamente la pierna derecha y simultánea baja la pierna izquierda.\n\nCambiar las piernas y repetir.",
  'ex_desc_30': "Párate con los pies de distancia de distancia y tus manos descansaron sobre tus caderas.\n\nluego dobla la pierna izquierda y inclina tu cuerpo hacia el lado izquierdo.\n\nmantenga la posición durante unos segundos, luego regrese y repita con el otro lado.",
  'ex_desc_31': "Párate directamente.\n\nluego retrocede con la pierna izquierda a la derecha y dobla las rodillas al mismo tiempo.\n\nvuelve a la posición de inicio y cambia al otro lado.",
  'ex_desc_32': "Párate directamente.\n\nluego camine la pierna derecha hacia atrás y baje el cuerpo.\n\nCuando subas, levanta la rodilla derecha lo más alto que puedas.\n\nvuelve a la posición de inicio y repite el ejercicio.",
  'ex_desc_33': "Párate directamente.\n\nluego pisa la pierna izquierda hacia atrás y baja el cuerpo.\n\nCuando subas, levanta la rodilla izquierda lo más alto que puedas.\n\nvuelve a la posición de inicio y repite el ejercicio.",
  'ex_desc_34': "Da un gran paso adelante con la pierna derecha y mantenga la parte superior de la parte superior del cuerpo recta.\n\nluego haz que tu cuerpo vaya directamente hacia abajo y hacia arriba.",
  'ex_desc_35': "Da un gran paso adelante con la pierna izquierda y mantenga la parte superior del cuerpo recta.\n\nluego haz que tu cuerpo vaya directamente hacia abajo y hacia arriba.",
  'ex_desc_36': "Párese recto con los pies juntos.\n\nMueve la pierna derecha hacia un lado, luego baje el cuerpo mientras mantiene la pierna izquierda recta.\n\nvuelve a la posición de inicio y cambia al otro lado.",
  'ex_desc_37': "Acuéstese y dobla las rodillas con los pies planos en el piso. Cruce los brazos frente a su pecho.\n\nluego levante la cabeza y los hombros para hacer un ángulo de 30 grados con el suelo.\n\nfunciona principalmente en el músculo y los oblicuos del recto abdomino.",
  'ex_desc_38': "Acuéstese boca arriba con las rodillas hacia arriba en un ángulo de 90\nde grado y los brazos se levantaron hacia el techo.\n\nBaje la pierna derecha y extiende el brazo izquierdo\npor encima de la cabeza.\n\nmanténgalo por un segundo, luego regrese a la posición de inicio\ny repita con el otro lado.",
  'ex_desc_39': "Acuéstese boca arriba y coloque las manos debajo de las caderas para obtener apoyo.\n\nluego levante las piernas hasta que se encuentren desde el ángulo recto con el piso.\n\nlentamente vuelve a colocar las piernas y repita el ejercicio.",
  'ex_desc_40': "Acuéstese boca arriba con las piernas extendidas y los codos directamente debajo de los hombros.\n\nLevante la pierna izquierda en un ángulo de 45 grados mientras llega a su brazo derecho hacia el lado izquierdo.\n\nluego vuelve lentamente a la posición inicial.\n\nRepita varias veces y luego cambie al otro lado.",
  'ex_desc_41': "Acuéstese en el piso con los dedos de los pies y los antebrazos en el suelo.\n\nMantenga su cuerpo recto y mantenga esta posición el mayor tiempo que pueda.\n\nEste ejercicio fortalece el abdomen, la espalda y los hombros.",
  'ex_desc_42': "Acuéstese boca arriba con los brazos a los lados y los hombros ligeramente levantados.\n\nlevanta las piernas del piso, dobla las rodillas y tírelas hacia el pecho.\n\npatea tus pies hacia adelante y repítelo.",
  'ex_desc_43': "Levántate en el piso, luego corre en su lugar mientras patea el talón para tocar tu trasero con cada paso.\n\nIntenta hacerlo lo más rápido que puedas.\n\nEs un gran ejercicio para el glúteo y los daños.",
  'ex_desc_44': "Acuéstese del lado izquierdo con el pie izquierdo detrás de su pie derecho.\n\nPon tu mano derecha detrás de tu cabeza y tu mano izquierda en el lado derecho de tus músculos oblicuos.\n\nlevanta el hombro izquierdo del piso.\n\nrepite el ejercicio.",
  'ex_desc_45': "Acuéstese en el lado derecho con el pie derecho detrás de su pie izquierdo.\n\nPon la mano izquierda detrás de la cabeza y la mano derecha en el lado izquierdo de los músculos oblicuos.\n\nlevante el hombro derecho hacia arriba del piso.\n\nrepite el ejercicio.",
  'ex_desc_46': "Acuéstese en el suelo con las piernas dobladas y los brazos a los costados.\n\nlevanta ligeramente la parte superior del cuerpo del piso y hace que sus manos alcancen los talones alternativamente.",
  'ex_desc_47': "Siéntese en el piso con las rodillas dobladas, los pies levantados un poco y hacia atrás titulado hacia atrás.\n\nlevanta alternativamente las piernas y aplauden debajo de las rodillas.",
  'ex_desc_48': "Acuéstese boca abajo con los brazos extendidos\nrecto por encima. Luego levante los dos brazos y las piernas hacia arriba del piso.\n\nmantiene esta posición durante dos segundos. Regrese a la posición de inicio\ny repita.",
  'ex_desc_49': "Acuéstese boca arriba con las piernas estiradas y las manos debajo de las caderas.\n\nlevanta las rodillas hasta que tus muslos estén perpendiculares al piso. Enderezar sus\npiernas y levantar las caderas del piso.\n\nRegrese a la posición inicial y repita el ejercicio. \norte",
  'ex_desc_50': "Comience con las rodillas debajo del trasero y las manos debajo de los hombros.\n\nluego estire la pierna derecha y el brazo izquierdo al mismo tiempo.\n\nmantenga durante cinco segundos, luego regrese y repita con el otroide.",
  'ex_desc_51': "Acuéstese en su lado izquierdo con su antebrazo admitiendo la parte superior de su cuerpo y su mano derecha en el suelo frente a usted.\n\nmantenga ambas piernas juntas. Levante las piernas ligeramente\ny mantenga por un segundo, luego regrese a la posición de inicio\n. Repita el ejercicio.",
  'ex_desc_52': "Acuéstese en su lado derecho con su antebrazo admitiendo la parte superior de su cuerpo y su mano izquierda en el suelo frente a usted.\n\nmantenga ambas piernas juntas. Levante las piernas ligeramente\ny mantenga por un segundo, luego regrese a la posición de inicio\n. Repita el ejercicio. \norte",
  'ex_desc_53': "Siéntese en el piso con las rodillas dobladas, los pies levantados un poco y hacia atrás titulado hacia atrás.\n\nluego mantenga sus manos juntas y gire de lado a lado.",
  'ex_desc_54': "Comience en la posición de flexión regular pero con las manos elevadas en una silla o banco.\n\nluego empuje su cuerpo hacia abajo con la fuerza de su brazo. Recuerde mantener su cuerpo recto.",
  'ex_desc_55': "Párate directamente. Luego, retroceda con la pierna izquierda y baje su cuerpo. Cuando subes, patea la pierna izquierda hacia arriba.\n\nvuelve a la posición de inicio y repite el ejercicio.",
  'ex_desc_56': "Párate directamente. Luego dé un paso atrás con la pierna derecha y baje el cuerpo. Cuando subes, patea la pierna derecha hacia arriba.\n\nvuelve a la posición de inicio y repite el ejercicio.",
  'ex_desc_57': "Para la posición de inicio, siéntese en la silla. Luego mueva la cadera de la silla con las manos sosteniendo el borde\nde la silla.\n\ndobla lentamente y estira los brazos para que tu cuerpo suba y baja. Este es un gran ejercicio para los tríceps.",
  'ex_desc_58': "Párate con los pies un poco más ancho que el hombro de ancho, los codos doblados, las palmas que miran a cada uno y otros dedos apuntaban hacia el techo.\n\nBaje su cuerpo hasta que sus muslos estén paralelos al piso. Cuando suba, gire su cuerpo a la izquierda, endereze la pierna derecha, levante el tacón derecho y estire y alcance su brazo derecho hacia la izquierda.\n\nRegrese a la posición de inicio y repita con el otro lado.",
  'ex_desc_59': "Acuéstese boca arriba con las rodillas dobladas y los brazos se estiran hacia adelante.\n\nluego levante la parte superior del cuerpo del piso.\n\nmantén por unos segundos y regrese lentamente.\n\nfunciona principalmente el músculo recto abdominal y los oblicuos.",
  'ex_desc_60': "Acuéstese sobre su lado izquierdo con la cabeza descansando en su brazo y piernas izquierdas extendidas.\n\nLevante y dobla la rodilla derecha frente a ti, y luego patea la pierna hacia atrás. Repita el ejercicio.",
  'ex_desc_61': "Acuéstese en su lado derecho con la cabeza descansando en su brazo derecho y piernas extendidas.\n\nLevante y dobla la rodilla izquierda frente a ti, y luego patea la pierna hacia atrás. Repita el ejercicio.",
  'ex_desc_62': "Acuéstese sobre su estómago y dobla los codos con las manos debajo de los hombros.\n\nluego empuje su pecho hacia arriba del suelo lo más posible.\n\nmantiene esta posición durante segundos.",
  'ex_desc_63': "Párate con el ancho del hombro de los pies separados. Dobla\ntus brazos frente a ti para mantener el equilibrio.\n\nBaje su cuerpo hasta que sus muslos estén paralelos con el piso. Ven a mitad de camino en lugar de venir todo el camino, luego en cuclillas nuevamente. Repetir.",
  'ex_desc_64': "Acuéstese plano sobre su espalda con la pierna derecha\nrecta en el suelo, y la pierna izquierda doblada con el pie izquierdo plano en el suelo.\n\napriete la pierna derecha y levántala directamente hasta que los muslos estén paralelos, luego baje lentamente.",
  'ex_desc_65': "Acuéstese plano sobre la espalda con la pierna izquierda\nrectamente en el suelo, y la pierna derecha se dobló con el pie derecho plano en el suelo.\n\napriete la pierna izquierda y levántala hacia arriba hasta que los muslos estén paralelos, luego baje lentamente.",
  'ex_desc_66': "Párate con los pies de ancho de los hombros separados. Coloque los brazos frente a su pecho para mantener su equilibrio.\n\nluego haz una sentadilla, y cuando subes, patea tu pierna izquierda hacia un lado. Repita el ejercicio\ny luego cambie a la pierna derecha.\n\ninhalar cuando bajas y exhala cuando subas. Sus rodillas deben extenderse en la línea con los dedos de los pies.\n\nEs un gran ejercicio para los cuádriceps y\nGluteus Maximus.",
  'ex_desc_67': "Acuéstese boca arriba con los brazos a los lados, las palmas hacia abajo y las piernas extendidas.\n\nLevanta las piernas y cruza el muslo derecho sobre la izquierda, luego invierta el ejercicio.\n\nAsegúrate de que tu espalda esté siempre plana.\n\nEs un gran ejercicio para los oblicuos y\nrecto abdomino.",
  'ex_desc_68': "Acuéstese boca arriba con las rodillas dobladas y los pies planos en el piso.\n\nluego levante una pierna mientras levanta las caderas del piso lo más alto que pueda.\n\nvuelve a la posición de inicio y repita con el otro lado.",
  'ex_desc_69': "Acuéstese boca arriba con las rodillas dobladas y los pies planos en el piso.\n\nluego levante una pierna mientras levanta las caderas del piso lo más alto que pueda.\n\nvuelve a la posición de inicio y repita con el otro lado.",
  'ex_desc_70': "Comience en una posición de tablón de brazo recto con las manos debajo de los hombros.\n\ncamina tus manos y pies hacia la izquierda al mismo tiempo. Da unos pasos a la izquierda, luego unos pocos pasos a la derecha. Repita el ejercicio.",
  'ex_desc_71': "Comience con el ancho del hombro de los pies separados.\n\ndobla tu cuerpo y camina tus manos frente a ti todo lo posible, luego camine hacia atrás.\n\nrepite el ejercicio.",
  'ex_desc_72': "Comience con el ancho del hombro de los pies separados.\ndobla ligeramente las piernas y inclina su cuerpo superior hacia adelante.\n\npone sus manos frente a usted para mantener\nequilibrio, luego corre en su lugar rápidamente.",
  'ex_desc_73': "Comience en una posición en cuclillas con las manos tocando los pies.\n\nsalta, separa las piernas y levanta los brazos por encima de los costados. Regrese a la posición de inicio y haga el próximo representante.",
  'ex_desc_74': "Comience con la posición del tablón.\n\ntrae una rodilla y el codo opuesto para tocarse entre sí, luego traerlos de vuelta.\n\nrepite con el otro lado.",
  'ex_desc_75': "Comience en la posición del tablón del brazo recto con las manos debajo de sus hombros y pies juntos.\n\nsalta los pies y aterriza sobre los dedos de los pies, luego regresa. Repita el ejercicio.",
  'ex_desc_76': "Párate con los pies separados con el ancho del hombro, luego pon tus manos en el suelo y patee los pies hacia atrás.\n\nhaz una flexión rápida y luego salta.",
  'ex_desc_77': "Párate con los pies de ancho del hombro y tus manos en las caderas.\n\nPase un gran hacia atrás con la pierna derecha y baje el cuerpo hasta que el muslo izquierdo esté paralelo al piso.\n\nregresa y repite con el otro lado.",
  'ex_desc_78': "Comience en la posición del tablón. Cambia tu cuerpo\nde un lado a otro.",
  'ex_desc_79': "Párate en el piso, pon tus manos frente a ti y salta de lado a lado.",
  'ex_desc_80': "Comience con los pies juntos y las manos levantadas sobre su cabeza.\n\nsalta, separa los pies, baja tus manos y en cuclillas.\n\nsalta a la posición de inicio y haz la siguiente representante.",
  'ex_desc_81': "Comience con las manos debajo de los hombros, la pierna izquierda doblada y al lado del exterior del brazo izquierdo y la pierna derecha estirada detrás de usted. Luego salta y cambia las piernas en el aire.",
  'ex_desc_82': "Coloque sus brazos a los costados y fingir su manejo de cuerda de omisión en cada mano.\n\nsalta y aterriza alternativamente en las bolas de los pies, girando las muñecas al mismo tiempo que si estuviera girando una cuerda.",
  'ex_desc_83': "Comience en la posición de la sentadilla, luego salte usando los músculos abdominales para obtener fuerza.\n\nEste ejercicio funciona tu abdomen.",
  'ex_desc_84': "Acuéstate en el suelo con los brazos que soportan tu cuerpo. Salta hacia adelante, lleve las rodillas hacia el pecho, luego vuelva a la posición inicial. Repita el ejercicio.",
  'ex_desc_85': "Comience en la posición del tablón del brazo recto.\nluego dobla el brazo derecho y coloca tu antebrazo en el suelo con el codo debajo de tu\nhombro, luego dobla el brazo izquierdo y sube a la posición tradicional del tablón.\n\nluego revertir y volver a la posición inicial. Repita el ejercicio.\n\nmantenga su cuerpo recto durante el ejercicio.\ninhalar cuando bajas y exhalas cuando subes.\n\nEs un gran ejercicio para los cuádriceps, los tríceps\ny los músculos abdominales.",
  'ex_desc_86': "Párese con la pierna izquierda en el suelo y la pierna derecha recta y levantada en su lado derecho.\n\nHaz un pequeño salto y balancea la pierna izquierda hacia el lado izquierdo. Cambie rápidamente las piernas y repita.",
  'ex_desc_87': "Comience en la posición de flexión regular, luego deje que sus rodillas toquen el piso y levante los pies hacia arriba del piso.\n\nSiguiente empuje tu cuerpo hacia arriba y hacia abajo.",
  'ex_desc_88': "Corre en su lugar mientras tira de las rodillas lo más alto posible con cada paso.\n\nMantenga la parte superior de su cuerpo en posición vertical durante este ejercicio.",
  'ex_desc_89': "Párate con el ancho del hombro de los pies separados.\n\nPon las manos en el suelo y patean los pies hacia atrás, luego trae tus pies hacia atrás y salta.\n\nrepite el ejercicio.",
  'ex_desc_90': "Párate con los pies juntos y los brazos a los costados.\n\nsalta con los pies separados y las manos por encima en forma de la letra \"X\".\n\nsalta hacia atrás, pon las manos en el suelo, patea las piernas hacia atrás y separas.\n\nvuelve a la posición de inicio y repite.",
  'ex_desc_91': "Siéntate en una silla. Actualizado ligeramente hacia atrás con los pies levantados del piso. Levanta la rodilla izquierda y llévala hacia el codo derecho. Cambie el lado y repita.",
  'ex_desc_92': "Siéntese en una silla y use su mano derecha para mantener el borde de la silla.\n\ngire la cabeza hacia el lado delantero izquierdo, y puso su mano izquierda en el lado derecho de su cabeza.\n\nluego tire de la cabeza suavemente hacia la izquierda\nfrontal. Manténgalo por unos segundos.",
  'ex_desc_93': "Siéntese en una silla y use su mano izquierda para sostener el borde de la silla.\n\ngire la cabeza hacia la parte frontal derecha, y ponga su mano derecha en el lado izquierdo de su cabeza.\n\nluego tire de la cabeza suavemente hacia la parte frontal derecha. Manténgalo por unos segundos.",
  'ex_desc_94': "Párate con el ancho del hombro de los pies separados.\npone sus manos en la pared para mantener el equilibrio.\n\ngira tus tobillos para hacer que tus dedos apunten\nhacia afuera, luego levante los talones hacia arriba y hacia abajo.",
  'ex_desc_95': "Párate con los pies del ancho del hombro separado y las manos detrás de las orejas.\n\nlevanta la rodilla derecha y usa el codo izquierdo\npara tocar la rodilla derecha. Cambie\nlados y repita.",
  'ex_desc_96': "Siéntate en una silla con la espalda recta. Lentamente levante la rodilla izquierda hacia arriba, luego bájalo lentamente hacia abajo.",
  'ex_desc_97': "Siéntate en una silla con la espalda recta. Lentamente levante la rodilla derecha hacia arriba, luego bájalo lentamente hacia abajo.",
  'ex_desc_98': "Comience con la espalda contra la pared, luego deslice hacia abajo hasta que sus rodillas estén en un ángulo de 90 grados.\n\nmantén la espalda contra la pared con las manos y los brazos lejos de las piernas.\n\nmantenga la posición.\n\nEl ejercicio es fortalecer los músculos cuádriceps.",
  'ex_desc_99': "Siéntese directamente en la silla con los pies planos en el piso.\n\nagarra el borde derecho de tu silla con la mano izquierda. Luego alcance su brazo derecho por encima y doble su cuerpo hacia la izquierda.\n\nmantenga esta posición.",
  'ex_desc_100': "Párate o siéntate con los brazos a los lados.\nenrolle los hombros hacia sus oídos, luego enrolle hacia atrás y apriétalos, luego enrolle. Repita el ejercicio.",
  'ex_desc_101': "Lleva la barbilla a tu pecho y manténgala durante unos segundos.\n\nluego mire hacia el techo, y también lo sostenga durante unos segundos. Repita el ejercicio\n.",
  'ex_desc_102': "Párate y mantén una silla con la mano derecha para mantener el equilibrio.\n\nLevante la pierna izquierda hacia su lado izquierdo tanto como sea posible. Regresar y repetir.",
  'ex_desc_103': "Pon tu mano derecha debajo de tu muslo con la palma. Mantenga el hombro derecho de la derecha.\n\nPon tu mano izquierda en el lado derecho de tu cabeza\n, luego tira suavemente de tu cabeza hacia la izquierda. Manténgalo por unos segundos.",
  'ex_desc_104': "Pon la mano izquierda debajo de tu muslo con la palma de la mano. Mantenga el hombro izquierdo\nplano.\n\nPon tu mano derecha en el lado izquierdo de tu cabeza\n, luego tira suavemente de tu cabeza hacia la derecha. Manténgalo por unos segundos.",
  'ex_desc_105': "Coloque su mano derecha en su espalda, use su mano izquierda para agarrar el codo derecho y tírelo suavemente.\n\nmantiene esta posición por un segundo.",
  'ex_desc_106': "Coloque su mano izquierda en su espalda, use su mano derecha para agarrar el codo izquierdo y tírelo suavemente.\n\nmantiene esta posición por un segundo.",
  'ex_desc_107': "Siéntese directamente en la silla con los pies planos en el piso.\n\nagarra el borde izquierdo de tu silla con tu mano derecha. Luego llegue a su brazo izquierdo por encima y dobla su cuerpo hacia la derecha.\n\nmantenga esta posición.",
  'ex_desc_108': "Párate con el ancho del hombro de los pies separados.\n\nPon tu mano izquierda detrás de tu cabeza y tu mano derecha a tu lado. Dobla tu cuerpo al lado derecho y baje la mano derecha hacia el piso.\n\npausa por un segundo y regrese al\n",
  'ex_desc_109': "Párese frente a una pared a un gran paso lejos de ella.\n\nluego ponga las manos directamente hacia la pared y se apoya contra ella.\n\ndobla lentamente los codos y presione la parte superior del cuerpo hacia el pozo.\n\nretrocede y repite el ejercicio.\n\nRecuerda mantener tu cuerpo recto.",
  'ex_desc_110': "Párate con tus pies 6-12 pulgadas de distancia. Estire\ntus brazos frente a ti.\n\nBaje su cuerpo hasta que sus muslos estén paralelos al piso. Regrese a la posición inicial y repita el ejercicio.",
  'ex_desc_111': "Párate recto con el hombro de los pies separados. Coloque sus manos sobre ambos lados\nde su cintura, los dedos hacia abajo y los codos hacia afuera.\n\ntire suavemente de los codos hacia atrás, luego llévelos de vuelta a la posición inicial.\nrepite el ejercicio.",
  'ex_desc_112': "Siéntese en una silla con la espalda recta y los pies planos en el suelo.\n\nagarra la parte posterior de la silla, inhala profundamente y abre el pecho y los hombros. Mantenga por\nunos segundos",
  'ex_desc_113': "Siéntese en el borde de una silla con la espalda recta, extienda la pierna izquierda frente a usted con el talón en el suelo, los dedos apuntando hacia arriba.\n\nalcanza ambas manos hacia tus dedos de los pies. Mantenga esta posición por unos segundos.",
  'ex_desc_114': "Siéntese en el borde de una silla con la espalda recta, extienda la pierna derecha frente a usted con el talón en el suelo, los dedos apuntando hacia arriba.\n\nalcanza ambas manos hacia tus dedos de los pies. Mantenga esta posición por unos segundos.",
  'ex_desc_115': "Párate con los pies separados.\npone tus manos detrás de ti y enclelo. Luego tira de los codos hacia atrás y extienda los brazos. Manténgalo por unos pocos segundos.",
  'ex_desc_116': "Prepare una silla que esté aproximadamente a la altura de sus rodillas y colóquela directamente detrás de usted.\n\npárate con el ancho del hombro de los pies y estira los brazos hacia adelante. Luego baje su cuerpo y siéntese lentamente en la silla.\n\nexprime tus glúteos y vuelve a la postura de pie. Repita el ejercicio.",
  'ex_desc_117': "Párate y sostén una silla con la mano izquierda para mantener el equilibrio.\n\nLevante la pierna derecha a su lado derecho tanto como sea posible. Regresar y repetir.",
  'ex_desc_118': "Acuéstese sobre su lado izquierdo con la cabeza descansando sobre su mano izquierda.\n\nluego levante la pierna derecha y gire el pie en círculos.",
  'ex_desc_119': "Acuéstese en su lado derecho con la cabeza descansando sobre su mano derecha.\n\nluego levante la pierna izquierda y gire el pie en círculos.",
  'ex_desc_120': "Siéntate y cruza las piernas en la colchoneta. Levante su brazo derecho por encima y coloque su mano izquierda en el piso para obtener apoyo.\n\nmira tu mano derecha y dobla lentamente su brazo izquierdo; Mientras tanto, dobla el cuerpo superior a la izquierda. Manténgalo por unos segundos.",
  'ex_desc_121': "Siéntate y cruza las piernas en la colchoneta. Levante su brazo izquierdo por encima y coloque su mano derecha en el piso para obtener apoyo.\n\nmira hacia la mano izquierda y dobla lentamente su brazo derecho; Mientras tanto, dobla el cuerpo superior a la derecha. Manténgalo por unos segundos.",
  'ex_desc_122': "Acuéstese sobre su lado izquierdo con la cabeza descansando sobre su brazo izquierdo y las rodillas dobladas.\n\nLevante la rodilla derecha hacia arriba mientras mantiene los tacones tocados, luego regrese a la posición inicial. Repita el ejercicio.",
  'ex_desc_123': "Acuéstese en su lado derecho con la cabeza descansando sobre su brazo derecho y rodillas dobladas.\n\nLevante la rodilla izquierda hacia arriba mientras mantiene los tacones tocados, luego regrese a la posición inicial. Repita el ejercicio.",
  'ex_desc_124': "Acuéstese en su lado derecho con la cabeza descansando sobre su mano derecha.\n\nluego ponte el pie izquierdo en el piso.\n\nlevanta la pierna derecha hacia arriba y hacia abajo.",
  'ex_desc_125': "Acuéstese sobre su lado izquierdo con la cabeza descansando sobre su mano izquierda.\n\nluego pon el pie derecho en el piso.\n\nlevanta la pierna izquierda hacia arriba y hacia abajo.",
  'ex_desc_128': "Siéntate en el piso, luego recién llegado y levanta las piernas del piso. Después de encontrar una posición de equilibrio, levante la parte superior del cuerpo y lleve las rodillas hacia su pecho. Luego estira y repite.\n\nexhala cuando levantas tu cuerpo e inhala cuando te estira.\n\nEs un gran ejercicio para el músculo abdominal inferior.",
  'ex_desc_129': "Acuéstese en el piso y levante las caderas del piso mientras mantiene la espalda recta.\n\nmantenga esta posición el mayor tiempo que pueda.\n\nEl ejercicio del puente fortalece todo el abdomen, la parte baja de la espalda y los glúteos.",
  'ex_desc_130': "Acuéstese boca arriba con los pies planos en el piso. Coloque el tobillo derecho sobre la rodilla izquierda, la mano izquierda detrás de la oreja y el brazo derecho se extienden hacia un lado en el piso.\n\nlevanta los hombros del piso, trae el codo izquierdo para encontrar la rodilla derecha y el brazo derecho cerca de tu cuerpo, luego regresa lentamente. Repita el ejercicio.",
  'ex_desc_131': "Acuéstese boca arriba con los pies planos en el piso. Coloque el tobillo izquierdo sobre la rodilla derecha, la mano derecha detrás de la oreja y el brazo izquierdo se extienden hacia el costado del piso.\n\nlevanta los hombros del piso, trae el codo derecho para encontrar la rodilla izquierda y el brazo izquierdo cerca de tu cuerpo, luego regresa lentamente. Repita el ejercicio.",
  'ex_desc_132': "Acuéstese sobre el estómago con las piernas extendidas y la barbilla en los brazos.\n\nlevanta las piernas del piso, luego levanta alternativamente las piernas izquierda y derecha.",
  'ex_desc_133': "Siéntese en el piso, levante las piernas en un ángulo de 45 grados y apoye la parte superior de la parte superior del cuerpo en un ángulo de 45 grados.\n\nestira los brazos hacia adelante.\n\nmantenga esta posición.",
  'ex_desc_134': "Acuéstese boca abajo con las rodillas dobladas y los talones apretados.\n\nluego levanta los pies hacia arriba y hacia abajo. El ejercicio es muy efectivo para apretar su trasero.",
  'ex_desc_135': "Acuéstese boca arriba con las rodillas dobladas, los pies planos en el suelo y las manos debajo de las caderas.\n\nlevanta las piernas a la posición de mesa; Deja caer tu pie izquierdo hacia el suelo. Toque el suelo con los dedos de los pies; Luego levanta la pierna hacia atrás. Cambie los lados y repita el ejercicio.",
  'ex_desc_136': "Acuéstese boca abajo en el piso con los brazos completamente extendidos y los pulgares apuntando hacia arriba, su cuerpo debe tener la forma de la letra \"Y\".\n\nlevanta los brazos del suelo lo más lejos que pueda y pause en la parte superior durante 2 segundos. Lentamente regrese la posición de inicio y repita el ejercicio. \norte",
  'ex_desc_137': "Siéntate en el piso con los pies juntos, y agarra tus dedos de los pies.\n\nabre las rodillas a los lados y presiona tus rodillas hacia abajo. Mantenga esta posición.",
  'ex_desc_138': "Acuéstese boca abajo con las piernas extendidas.\n\ndobla las rodillas y llévalas hacia su pecho; Abraza tus rodillas con ambas manos. Espera durante unos segundos.",
  'ex_desc_139': "Acuéstese boca arriba con las rodillas hacia arriba en un ángulo de 90\nde grado.\n\nextiende los brazos a los lados y coloca tus palmas en el suelo.\n\ngire las piernas hacia la izquierda mientras mantiene su parte superior del cuerpo en su lugar y sus rodillas y pies juntos.\n\nmanténgalo por un segundo, luego regrese y gire a\nel otro lado. Repita el ejercicio.",
  'ex_desc_140': "Comience en una posición de tablón estándar.\n\ngire la columna vertebral hacia su lado izquierdo hasta que su pierna izquierda toque el piso, luego gire al otro lado.\n\nrepite el ejercicio.",
  'ex_desc_141': "Acuéstese boca arriba con las manos estiradas a los costados y las piernas separadas.\n\nlevanta las piernas y los brazos del piso. Luego levante la parte superior del cuerpo y apriete los brazos y las rodillas hacia los abdominales.\n\nBaje los brazos y las piernas (pero no toque el piso) y repita el ejercicio.",
  'ex_desc_142': "Comience en cuatro patas con las rodillas debajo de su trasero y sus manos directamente debajo de sus hombros.\n\nLevante la pierna derecha hacia atrás, luego bájalo\nal lado izquierdo. Levántalo de nuevo y bájalo\ndirectamente hacia abajo.\n\nPor favor, no dejes que tu pie derecho toque el piso\n. Repita los pasos.",
  'ex_desc_143': "Comience en cuatro patas con las rodillas debajo de su trasero y sus manos directamente debajo de sus hombros.\n\nLevante la pierna izquierda hacia atrás, luego bájala\nal lado derecho. Levántalo de nuevo y bájalo\ndirectamente hacia abajo.\n\nPor favor, no dejes que tu pie izquierdo toque el piso.\nrepite los pasos.",
  'ex_desc_145': "Mantenga sus antebrazos juntos a la altura del hombro y doble los codos con las manos juntas para hacer una forma.\n\nLuego levante los antebrazos hacia arriba y hacia abajo.",
  'ex_desc_146': "Acuéstese boca abajo con las piernas rectas y los brazos levantados y extendidos por encima.\n\ndobla los codos y tómalos hacia abajo a los lados. Regresa a la posicion inicial y repite.",
  'ex_desc_147': "Párate con el ancho del hombro de los pies separados. Mantenga una mancuerna en cada mano a los lados.\n\nlevanta los brazos con el brazo izquierdo frente a usted y el brazo derecho en su lado derecho.\n\nRegrese a la posición inicial, cambie los brazos y repita.",
  'ex_desc_148': "Párate con el ancho del hombro de los pies separados. Inclínese hacia adelante, dobla ligeramente las rodillas y sienta las caderas hacia atrás. Sostenga una pesa en cada mano.\n\ndobla los codos y tíralos hacia atrás. Baje las manos y repita el ejercicio.",
  'ex_desc_149': "Acuéstese boca arriba con las rodillas dobladas y los pies planos en el piso.\n\nmantenga una mancuerna en cada mano y levanta los brazos hacia el techo con las palmas frente a la otra y los codos ligeramente doblados.\n\nBaje las pesas a los lados hasta que los brazos superiores tocen el piso. Regrese y repita el ejercicio.",
  'ex_desc_150': "Acuéstese boca arriba con las piernas levantadas, las rodillas dobladas y los tacones apretados.\n\nPon los brazos planos a los lados.\n\nendereza las piernas y llévalas de vuelta a la posición inicial.\n\nrepite el ejercicio.",
  'ex_desc_151': "Acuéstese boca arriba con los brazos en sus lados. Levanta las piernas y manténgalas en la medida de lo que pueda.\n\nextiende tus piernas, luego tráigas de vuelta.\nrepite el ejercicio.",
  'ex_desc_152': "Acuéstese boca arriba con las piernas dobladas y levantadas. Realice la acción del ciclismo con las piernas varias veces, luego inviertala.",
  'ex_desc_153': "Comience con las manos debajo de los hombros, la rodilla derecha directamente debajo de su trasero y la pierna izquierda se estiró y descansó en el suelo.\n\nLevanta la pierna izquierda al lado izquierdo. Regrese a la posición de inicio y repita el ejercicio.",
  'ex_desc_154': "Comience con las manos debajo de los hombros, la rodilla izquierda directamente debajo de su trasero y su pierna derecha se estiró y descansó en el suelo.\n\nLevanta la pierna derecha en su lado derecho. Regrese a la posición de inicio y repita el ejercicio.",
  'ex_desc_155': "Coloque un brazo sobre su cuerpo, paralelo al suelo, luego use el otro brazo para tirar del brazo paralelo hacia su pecho.\n\nmantén por un tiempo, cambie el brazo y repita el ejercicio.\n\nMantenga el brazo interior recto durante el ejercicio.",
  'ex_desc_156': "Párate con tu mano derecha en la pared.\n\ndobla la pierna izquierda y agarra el tobillo o los dedos de los pies para acercar el ternero izquierdo a su muslo izquierdo.\n\nmantenga esta posición.",
  'ex_desc_157': "Párate con tu mano izquierda en la pared. Dobla\ntu pierna derecha y agarra el tobillo o los dedos de los pies para acercar tu ternero derecho a tu muslo derecho. Mantenga esta posición.",
  'ex_desc_158': "Ponte un gran paso de distancia frente a una pared.\n\navanza con el pie izquierdo y empuja la pared con las manos.\n\nPor favor, asegúrese de que su pierna derecha esté completamente extendida y que pueda sentir el estiramiento de su ternero derecho.\n\nmantiene esta posición durante unos segundos.",
  'ex_desc_159': "Ponte un gran paso de distancia frente a una pared.\n\navanza con el pie derecho y empuja la pared con las manos.\n\nPor favor, asegúrese de que su pierna izquierda esté completamente extendida y que pueda sentir que su ternera izquierda se estira.\n\nmantiene esta posición durante unos segundos.",
  'ex_desc_160': "Comience con las rodillas y las manos en el piso.\n\npone las manos un poco hacia adelante, amplíe las rodillas y junte los dedos de los pies.\n\nrespirar, luego exhala y siéntate.\n\ntrata de hacer que tu trasero toque tus talones.\n\nRelaja los codos, haz que tu frente toque el piso e intente bajar el pecho cerca del piso.\n\nmantenga esta posición.\n\nMantenga los brazos estirados hacia adelante mientras se siente hacia atrás.\n\nasegúrese de que haya suficiente espacio entre los hombros y los oídos durante el ejercicio.",
  'ex_desc_161': "Acuéstese en el piso con los pies juntos.\n\nAbre las rodillas a los lados.\n\nmantenga esta posición.",
  'ex_desc_162': "Acuéstese boca arriba con las piernas rectas y los brazos estirados a los costados.\n\nlevanta las rodillas y gira las piernas hacia la derecha.\n\nmantenga este ejercicio.",
  'ex_desc_163': "Acuéstese boca arriba con las piernas rectas y los brazos estirados a los costados.\n\nlevanta las rodillas y gira las piernas hacia la izquierda.\n\nmantenga este ejercicio.",
  'ex_desc_164': "Comience en la posición del tablón del brazo recto.\nLevante el brazo derecho y la pierna izquierda hasta que estén paralelas al suelo.\nRegrese a la posición de inicio y repita con el otro lado.",
  'ex_desc_165': "Párate frente a una silla. Luego pise la silla\ny vuelva a bajar.\n\nEl ejercicio funciona para fortalecer las piernas y las nalgas.",
  'ex_desc_166': "Siéntate en un banco, pon tus manos detrás de ti y agarra el banco, inclina tu cuerpo hacia atrás.\n\nlevanta las piernas, dobla las rodillas y trae las rodillas hacia el pecho. Extender completamente las piernas y repita.",
  'ex_desc_167': "Encuentre una puerta, tome una posición en la puerta en la puerta de\ncon los brazos en el marco de la puerta y los codos un poco más bajos que los de los hombros, luego traiga lentamente su pecho hacia adelante.\n\nmantiene esta posición durante 30-40 segundos. Luego, salga lentamente, levante los brazos y haga un par de rollos de hombros.\n\nno tire de la cabeza hacia adelante y mantenga su cuello relajado.",
  'ex_desc_168': "Acuéstese boca arriba con las piernas extendidas.\nLevante la pierna derecha hacia arriba y use su mano izquierda\npara tirar de la rodilla derecha hacia la izquierda, pero mantenga\nsu otro brazo extendido al lado del piso.\n\nmantiene esta posición durante unos segundos.",
  'ex_desc_169': "Acuéstese boca arriba con las piernas extendidas.\n\nLevante la pierna izquierda hacia arriba y use su mano derecha\npara tirar de la rodilla izquierda hacia la derecha, pero mantenga\nsu otro brazo extendido al costado en el piso.\n\nmantiene esta posición durante unos segundos.",
  'ex_desc_170': "Comience en una posición de flexión.\n\nTrae la rodilla izquierda hacia adelante y deja caer la rodilla derecha en el piso.\n\nlevanta la parte superior del cuerpo y ponga las manos sobre la cintura.\n\nluego empuja las caderas hacia adelante mientras mantiene la parte superior de la parte superior del cuerpo recta.\n\nPor favor, asegúrese de que su rodilla delantera no se pase de los dedos de los pies.\n\nmantiene esta posición durante unos segundos.",
  'ex_desc_171': "Comience en una posición de flexión.\n\nTrae la rodilla derecha hacia adelante y deja caer la rodilla izquierda en el piso.\n\nlevanta la parte superior del cuerpo y ponga las manos sobre la cintura.\n\nluego empuja las caderas hacia adelante mientras mantiene la parte superior de la parte superior del cuerpo recta.\n\nPor favor, asegúrese de que su rodilla delantera no se pase de los dedos de los pies.\n\nmantiene esta posición durante unos segundos.",
  'ex_desc_172': "Párate en el piso con las manos descansadas en tus caderas y los pies de ancho de hombro\naparte.\n\nLevante la pierna izquierda hacia arriba en el nivel de la cintura y dobla la rodilla en ángulo recto.\n\nluego gire su cuerpo hacia el lado izquierdo y rotar hacia atrás. Cambie los lados y repita el ejercicio\n.\n\nMantenga los dedos de los dedos de su pierna de pie hacia adelante. Tus rodillas deben enfrentar la misma dirección que los dedos de los pies.",
  'ex_desc_173': "Párate en el piso, dobla ligeramente las piernas y inclina la parte superior del cuerpo hacia adelante.\n\nluego salta a la derecha. Mientras saltas, trae tu pie izquierdo detrás de ti y tu brazo izquierdo frente a ti.\n\nluego salta al otro lado. Repita el ejercicio.",
  'ex_desc_174': "Párate con los pies separados al ancho de los hombros y coloca tu pie dominante ligeramente hacia adelante.\ndobla ligeramente las rodillas, aprieta los puños y dobla los codos a 90 grados.\n\nLevante el brazo derecho a la altura del hombro y mantenga su antebrazo paralelo al suelo. Gire sus\nhombros y caderas y golpee hacia la izquierda.\nSwitch lados y repite.",
  'ex_desc_175': "Acuéstate en el suelo con los brazos que soportan tu cuerpo.\n\nMantenga su cuerpo recto mientras levanta y baja su cuerpo con los brazos.\n\nEste ejercicio funciona el cofre, los hombros, los tríceps, la espalda y las piernas.",
  'ex_desc_176': "Comience en la posición de flexión. Luego baja por una flexión y a medida que subas, gira tu cuerpo superior y extiende tu brazo derecho hacia arriba.\n\nrepite el ejercicio con el otro brazo. Es un gran ejercicio para el cofre, los hombros, los brazos y el núcleo.",
  'ex_desc_177': "Acuéstese en su lado derecho con su antebrazo admitiendo su cuerpo. Mantenga su cuerpo en una línea recta.\n\nEste ejercicio se dirige a los músculos abdominales y\noblicuos.",
  'ex_desc_178': "Acuéstese en su lado izquierdo con su antebrazo que soporta su cuerpo. Mantenga su cuerpo en línea recta.\n\nEste ejercicio se dirige a los músculos abdominales y\noblicuos.",
  'ex_desc_179': "Acuéstese boca arriba con las rodillas dobladas y los pies planos en el piso. Coloque los brazos recto sobre la parte superior de su cabeza.\n\nlevanta la parte superior del cuerpo del piso, luego lentamente vuelve a la posición de inicio. El ejercicio aumenta la resistencia abdominal.",
  'ex_desc_180': "Párate con los pies separados el ancho del hombro y las rodillas ligeramente dobladas.\n\nlevanta los brazos frente a ti con los codos\ndoblados.\n\ngire la parte superior del cuerpo hacia la izquierda y luego la derecha.",
  'ex_desc_181': "Acuéstese boca arriba con las piernas rectas y las manos a los costados.\n\nLevanta la pierna derecha hacia el techo. Sostenga\nla parte posterior de su muslo con las manos.\nmantener esta posición.",
  'ex_desc_182': "Acuéstese boca arriba con las piernas rectas y las manos a los costados.\n\nLevanta la pierna izquierda hacia el techo. Sostenga\nla parte posterior de su muslo con las manos.\nmantener esta posición.",
  'ex_desc_183': "Párate en el piso con los brazos extendidos a los lados a la altura del hombro.\n\nluego dobla el cuerpo y usa la mano izquierda para tocar el pie derecho o obtener lo más cerca posible. Cambie los lados y repita.\n\nexhalan cuando dobla su cuerpo e inhale cuando sube.\n\nMantenga la espalda y las piernas rectas durante el ejercicio.",
  'ex_desc_184': "Párate con las manos sobre tu cintura. Levante la pierna izquierda y muévala en el sentido de las agujas del reloj en grandes círculos, luego muévala en sentido antihorario.\ncambia de piernas y repite el ejercicio.",
  'ex_desc_185': "Acuéstese sobre su lado izquierdo con la cabeza descansando en su brazo izquierdo.\n\ndobla las rodillas en un ángulo de 90 grados en el frente de usted.\n\nendereza la pierna derecha y levántala directamente hacia arriba y hacia abajo.",
  'ex_desc_186': "Acuéstese en su lado derecho con la cabeza descansando en su brazo derecho.\n\ndobla las rodillas en un ángulo de 90 grados en el frente de usted.\n\nendereza la pierna izquierda y levántala directamente hacia arriba y hacia abajo.",
  'ex_desc_187': "Pon una almohada en el fondo de la pared. Acuéstate en tu espalda, levanta y pon tus piernas en el muro.\n\nmueve sus caderas sobre la almohada, lo más cerca que puede. Mantenga esta posición.",
  'ex_desc_188': "Párate en el piso, luego dobla la pierna izquierda y agarra el tobillo o los dedos de los pies para acercar tu ternero izquierdo a tu muslo izquierdo.\n\nmantenga esta posición durante unos segundos, luego cambia los lados y repite.\n\nsu rodilla levantada siempre debe ir recta\nhacia abajo, y la parte superior de su cuerpo debe mantenerse en recta durante el ejercicio.",
  'ex_desc_190': "Acuéstese en el piso con las piernas extendidas.\n\nLevanta la rodilla derecha y la agarra con ambas manos.\n\ntire de la rodilla derecha hacia su pecho tanto como pueda mientras mantiene la pierna izquierda recta en el suelo.\n\nmantiene esta posición durante unos segundos.",
  'ex_desc_191': "Acuéstese en el piso con las piernas extendidas.\n\nLevanta la rodilla izquierda y la agarra con ambas manos.\n\ntire de la rodilla izquierda hacia su pecho tanto como pueda mientras mantiene la pierna derecha recta en el suelo.\n\nmantiene esta posición durante unos segundos.",
  'ex_desc_192': "Comience con la rodilla izquierda y las manos en un banco, coloque las manos directamente debajo de sus\nhombros.\n\nLuego patee la pierna derecha hasta que esté paralelo a la tierra. Regrese a la posición inicial\ny repita el ejercicio.",
  'ex_desc_193': "Comience con la rodilla derecha y las manos en un banco, coloque las manos directamente debajo de sus\nhombros.\n\nLuego patee la pierna izquierda hasta que esté paralela a\nel suelo. Regrese a la posición inicial y repita el ejercicio.",
  'ex_desc_194': "Siéntate con las piernas extendidas frente a ti.\ndobla la pierna izquierda con el pie izquierdo cerca de tu muslo derecho.\n\ninclina la parte superior del cuerpo hacia adelante. Mantenga esta posición\n.",
  'ex_desc_195': "Siéntate con las piernas extendidas frente a ti.\ndobla la pierna derecha con el pie derecho\ncerca de su muslo izquierdo.\n\ninclina la parte superior del cuerpo hacia adelante. Mantenga esta posición\n.",
  'ex_desc_196': "Párate en el piso con los pies juntos.\n\nluego dobla tu cuerpo y acerca tu cuerpo superior a tus piernas como puedas.\n\nmantenga esta posición durante unos segundos y se repita.\n\nexhalan cuando dobla su cuerpo e inhale cuando sube. Mantenga sus piernas rectas durante el ejercicio.",
  'ex_desc_197': "Comience en cuatro patas con las rodillas debajo de su trasero y sus manos directamente debajo de sus hombros.\n\nendereza las piernas y levante las caderas en una forma 'V' al revés. Difune los pies\ny extiende los dedos. Transfiera su peso a sus piernas. Mantenga esta posición\n.",
  'ex_desc_198': "Comience en cuatro patas con las rodillas debajo de su trasero y sus manos debajo de sus hombros.\n\nTrae la rodilla derecha hacia adelante, coloque el pie derecho en el suelo entre la mano izquierda y la rodilla izquierda y deje caer la rodilla derecha\ncerca de la muñeca derecha en el suelo.\n\ndesliza tu pierna izquierda hacia atrás. Coloque sus\nantebrazos en el suelo frente a su pierna, con los dedos separados y las palmas de las palmas. Espera durante unos segundos.",
  'ex_desc_199': "Comience en cuatro patas con las rodillas debajo de su trasero y sus manos debajo de sus hombros.\n\nTrae la rodilla izquierda hacia adelante, coloque el pie izquierdo en el suelo entre la mano derecha y la rodilla derecha y deje caer la rodilla izquierda\ncerca de la muñeca izquierda en el suelo.\n\ndesliza tu pierna derecha hacia atrás. Coloque sus\nantebrazos en el suelo frente a su pierna, con los dedos separados y las palmas de las palmas. Espera durante unos segundos.",
  'ex_desc_200': "Levántate con los brazos a los costados. Cruce\nsu pierna izquierda detrás de su pierna derecha.\n\nextiende ambos brazos sobre tu cabeza, agarra la palma izquierda con la mano derecha y tíralas a tu lado derecho. Dobla la parte superior del cuerpo hacia tu lado derecho.\nmantenga por unos segundos.",
  'ex_desc_201': "Levántate con los brazos a los costados. Cruce\nsu pierna derecha detrás de su pierna izquierda.\n\nextiende ambos brazos sobre tu cabeza, agarra tu palma derecha con la mano izquierda y tíralas hacia tu lado izquierdo. Dobla la parte superior del cuerpo a tu lado izquierdo.\nmantenga por unos segundos.",
  'ex_desc_202': "Párese frente a una pared con los pies separados un poco más\nmás\nancho de los hombros, y las caderas contra la pared.\n\ndobla las rodillas para hacer una sentadilla 1/4 y luego regresa a la posición inicial. Repita el ejercicio\n.",
  'ex_desc_203': "Siéntate en una silla con la espalda recta. Lentamente extiende la pierna derecha hasta que esté recta y paralela al suelo, luego báñelo lentamente hacia abajo.\nrepite el ejercicio.",
  'ex_desc_204': "Siéntate en una silla con la espalda recta. Lentamente extiende la pierna izquierda hasta que esté recta y paralela al suelo, luego baje lentamente. Repita el ejercicio.",
  'ex_desc_205': "Acuéstese en su lado derecho con las manos en el suelo para obtener apoyo.\n\nColoque un rodillo de espuma debajo del lado lateral de su muslo derecho y coloque el pie izquierdo hacia adelante en el piso\n. Enrolle el muslo hacia adelante y hacia atrás de su cadera hasta su rodilla.",
  'ex_desc_206': "Acuéstese en el lado izquierdo con las manos en el suelo para obtener apoyo.\n\nColoque un rodillo de espuma debajo del lado lateral\nde su muslo izquierdo y pon el pie derecho hacia adelante en el piso. Enrolle el muslo hacia atrás y hacia atrás de su cadera a la rodilla.",
  'ex_desc_207': "Coloque propenso en el suelo con los antebrazos que soportan en el suelo y las palmas hacia abajo.\n\nPon un rodillo de espuma debajo de los muslos y levante los\npies del suelo. Enrolle los cuádriceps desde su cadera hasta las rodillas de un lado a otro.",
  'ex_desc_208': "Siéntate en el piso con las piernas extendidas en el frente de ti. Coloque un rodillo de espuma debajo de los muslos, ponga las manos detrás de usted en el piso para obtener apoyo.\n\nlevanta los pies del suelo y enrolla tus isquiotibiales de tus caderas a tus rodillas hacia atrás.",
  'ex_desc_209': "Siéntate en el piso con las piernas extendidas en el frente de ti. Coloque un rodillo de espuma debajo de sus rodillas, y coloque sus manos detrás de usted en el piso para obtener un soporte.\n\nlevante lentamente el pie derecho y endereze la pierna tanto como pueda. Luego lentamente bájalo. Repita\nel ejercicio.",
  'ex_desc_210': "Siéntate en el piso con las piernas extendidas en el frente de ti. Coloque un rodillo de espuma debajo de sus rodillas, y coloque sus manos detrás de usted en el piso para obtener un soporte.\n\nlevanta lentamente el pie izquierdo y endereza la pierna tanto como pueda. Luego lentamente bájalo. Repita\nel ejercicio.",
  'ex_desc_211': "Acuéstese boca arriba con las rodillas dobladas y los pies planos en el suelo.\n\naplanar su espalda baja en el suelo para eliminar el espacio entre la espalda baja y el piso, luego regrese a la posición inicial.\n\nrepite el ejercicio.",
  'ex_desc_212': "Camina despacio. Coloque el talón en el suelo, ruede completamente a través del pie hasta los dedos de los pies, luego empuje hacia adelante con los dedos de los pies.",
  'ex_desc_213': "Párate con los brazos contra una pared. Pon tu pie derecho en el tobillo izquierdo, luego levante el tacón izquierdo hacia arriba y hacia abajo.",
  'ex_desc_214': "Párate con los brazos contra una pared. Pon el pie izquierdo en el tobillo derecho, luego levante el tacón derecho hacia arriba y hacia abajo.",
  'ex_desc_215': "Comience en la posición de flexión, pero mantenga sus brazos rectos. Este ejercicio fortalece su abdomen y los músculos de la espalda.",
  'ex_desc_216': "Acuéstate en tu lado izquierdo. Coloque el codo izquierdo\ndirectamente debajo de los hombros y coloque su mano derecha en su cintura. Coloque la pierna derecha\nen la pierna izquierda.\n\neleva las caderas hacia arriba, mantenga por 2-4\nsegundos, luego vuelva a la posición de inicio.\n\nrepite este ejercicio.",
  'ex_desc_217': "Acuéstate en tu lado derecho. Coloque su codo derecho\ndirectamente debajo de sus hombros y coloque su mano izquierda en su cintura. Coloque su pierna izquierda en su pierna derecha.\n\neleva las caderas hacia arriba, mantenga por 2-4\nsegundos, luego vuelva a la posición de inicio.\n\nrepite este ejercicio.",
  'ex_desc_218': "Comience en una posición de tablón tradicional, luego extiende alternativamente un brazo hacia adelante.\n\nmantenga su cuerpo recto durante el ejercicio.\n\nEs un gran ejercicio para el músculo abdominal\ny el músculo deltoides.",
  'ex_desc_219': "Comience en una posición del tablón del lado derecho, luego levante la parte superior de la pierna y patea hacia adelante. Regrese a la posición de inicio y repita.\n\nno influya en las caderas y mantenga las piernas y la parte superior del cuerpo recta durante el ejercicio.\n\nexhala cuando tu pierna se apaga e inhala cuando regrese la pierna.\n\nEs un gran ejercicio para el glúteo y\ncuádriceps.",
  'ex_desc_220': "Comience en una posición del tablón del lado izquierdo, luego levante la parte superior de la pierna y patea hacia adelante. Regrese a la posición de inicio y repita.\n\nno influya en las caderas y mantenga las piernas y la parte superior del cuerpo recta durante el ejercicio.\n\nexhala cuando tu pierna se apaga e inhala cuando regrese la pierna.\n\nEs un gran ejercicio para el glúteo y\ncuádriceps.",
  'ex_desc_221': "Siéntese en el piso con las piernas dobladas, las caderas hacia arriba y los dedos apuntando hacia adelante debajo de sus hombros.\n\npatea tus pies en el aire alternando a la izquierda y a la derecha.",
  'ex_desc_222': "Acuéstese boca arriba con las manos detrás de las orejas.\n\nluego levante la parte superior del cuerpo del piso y lentamente hasta la posición sentada. No tires de tu cuello cuando te levantes.\n\nvuelve lentamente a la posición de inicio y repita el ejercicio.\n\nSi le duele la columna vertebral, cambie a otro entrenamiento.",
  'ex_desc_223': "Acuéstese boca arriba con las manos a los costados y las piernas hacia el techo.\n\nlevanta las caderas hacia arriba del piso, luego vuelve a la posición inicial.\n\nrepite el ejercicio.",
  'ex_desc_224': "Párate con el ancho del hombro de los pies separados.\n\nPon las manos en el suelo y patea los pies hacia atrás. Dobla la rodilla derecha hacia tu pecho y mantén la pierna izquierda recta, luego cambia rápidamente a la pierna izquierda.\n\npatea tu pie izquierdo hacia atrás, luego salta. Repita el ejercicio.",
  'ex_desc_225': "Comience en la posición mentirosa con las rodillas dobladas y los pies ligeramente separados.\n\ncoloca tus manos detrás de tus oídos. Levante la parte superior del cuerpo y gire a un lado.\n\nlentamente volver a la posición inicial. Repita con el otro lado.",
  'ex_desc_226': "Acuéstese boca arriba con las piernas directamente hacia el techo y las manos a los costados.\n\nbaja una de tus piernas hacia abajo. Cuando lo levante, levante las caderas del piso.\n\nregresa a la posición inicial. Cambie a la otra pierna y repita el ejercicio.",
  'ex_desc_227': "Siéntese con las palmas de las palmas detrás de las caderas en el suelo a los lados.\n\nextiende tus piernas y levántala del suelo. Mueva las piernas en sentido antihorario en círculos.",
  'ex_desc_228': "Párate en el piso con los brazos extendidos hacia los lados a la altura del hombro.\n\nMueve los brazos en el sentido de las agujas del reloj en círculos rápidamente.\n\nIntenta hacerlo lo más rápido que puedas.\n\nEs un gran ejercicio para el músculo deltoides.",
  'ex_desc_229': "Acuéstese del lado izquierdo con su antebrazo sosteniendo su cuerpo y rodillas dobladas en el piso.\n\nMantenga la columna vertebral recta. Mantenga esta posición.",
  'ex_desc_230': "Acuéstese en su lado derecho con su antebrazo sosteniendo su cuerpo y rodillas dobladas en el piso.\n\nMantenga la columna vertebral recta. Mantenga esta posición.",
